export const IconsSVG = (name: string) => {
  const iconsStyle = "fill-white h-16"
  switch (name) {
    case "React":
      return <ReactIcon className={iconsStyle} />;
    case "Next.js":
      return <NextJSIcon className={iconsStyle} />;
    case "Vue3":
      return <VueIcon className={iconsStyle} />;
    case "Nuxt.js":
      return <NuxtJSICon className={iconsStyle} />;
    case "TypeScript":
      return <TypeScriptIcon className={iconsStyle} />;
    case "Node.js":
      return <NodeJSIcon className={iconsStyle} />;
    case "Git":
      return <GitIcon className={iconsStyle} />
    case "GitHub":
      return <GithubIcon className={iconsStyle} />;
    case "RESTful APIs":
      return <RESTfulAPIsIcon className={iconsStyle} />;
    case "Responsive Websites":
      return <RWDIcon className={iconsStyle} />
    case "Tailwind":
      return <TailwindCSSIcon className={iconsStyle} />;
    case "styled-components":
      return <StyledComponents className={iconsStyle} />;
    case "Sass":
      return <SassIcon className={iconsStyle} />;
    case "PostCSS":
      return <PostCSSIcon className={iconsStyle} />;
    case "Figma":
      return <FigmaIcon className={iconsStyle} />;
    case "Firebase":
      return <FirebaseIcon className={iconsStyle} />;
    default:
      return <QuestionIcon className={iconsStyle} />;
  }
}

